import React from 'react';

import {Login} from './Login';

class Calendar extends React.Component {

  constructor() {
    super();
    this.state = {
      firstName : "",
      lastName : "",
      gmail : ""
    };
  }

  render() {
    return (
      <React.Fragment>
        <p>Sign in to download calendar data</p>
        <button>Sign in with Google</button>
        <a href="/meeting">Meeting Page</a>
        <p>This will contain an empty calendar which will be filled in when signed in</p>

        <button>Print first name</button>

        <Login firstName={this.state.firstName} lastName={this.state.lastName} gmail={this.state.gmail} />

      </React.Fragment>
    )
  }
}

export default Calendar
